import { PageWrapper, LinkButton } from '../../components/shared/CommonStyles';
import React from 'react';
import styled from 'styled-components';

const Home = () => {
  return (
    <PageWrapper>
      <LinkButton to="/postos"> Ver Postos de Vacinação </LinkButton>
    </PageWrapper>
  );
};

const HomeWrapper = styled.div`
  color: black;
  font-size: 100px;
  height: 100vh;
`;

export default Home;
